import React, { useState } from 'react';
import { StyleSheet, View, Text, Image, TextInput } from 'react-native';
import {useDispatch, useSelector} from "react-redux";
import { BoldAppText, MediumAppText } from '../styles/text'
import {Picker} from '@react-native-community/picker';

function Moods () {

  const [stateOne, setStateOne] = useState(false)
  const [stateTwo, setStateTwo] = useState(false)

  return (
    <View style={styles.container}>
      <BoldAppText>Select a set of moods for today</BoldAppText>
      <View>
      <MediumAppText>Are you feeling good?</MediumAppText>
      <Picker
        selectedValue={stateOne}
        style={{height: 50, width: 100}}
        onValueChange={(itemValue, itemIndex) =>
        setStateOne(itemValue)
      }>
        <Picker.Item label="Happy" value="Happy" />
        <Picker.Item label="Positive" value="Positive" />
        <Picker.Item label="Energetic" value="Positive" />
        <Picker.Item label="Calm" value="Calm" />
      </Picker>
      </View>
      <View>
      <MediumAppText>Or are things a little bit tough?</MediumAppText>
      <Picker
        selectedValue={stateTwo}
        style={{height: 50, width: 100}}
        onValueChange={(itemValue, itemIndex) =>
        setStateTwo(itemValue)
      }>
        <Picker.Item label="Anxious" value="Anxious" />
        <Picker.Item label="Worried" value="Worried" />
        <Picker.Item label="Stressed" value="Stressed" />
      </Picker>
      </View>
      <View>
      <MediumAppText>Or input yours here...</MediumAppText>
      <TextInput
        placeholder='Enter a mood'
        value= {''}
        onChangeText={text => text}
        textContentType={'mood'}
      />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
  },
});



export default Moods;
